package guma;

public class Compare {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=25;
		int b=39;
		if(a>b) {
			System.out.println("25<=39");
		}
		else if(a<b) {
			System.out.println("25<39");
			
		}
		else {
			System.out.println("25!=39");
		}

	}

}
